  \"2016-04-01T18:54:52.082458\",\n\t\"name\": \"ward-county-aerial-photography-2015\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset consists of tiled orthogonal
  imagery produced from nadir images captured by Pictometry International during the
  period of April 18th, 2015 to May 10th, 2015. Automatic aerial triangulation (AAT)
  was performed. The triangulated frames were rectified to a Pictometry flown LiDAR
  derived DEM. Mosaicing was performed using an automatic seaming algorithm and manually
  edited to eliminate seams through elevated features where possible.nnImages within
  Ward County are nominal 9u201d Ground Sample Distance (GSD).\",\n\t\"license_title\":
